func TestAccIbmLogsDashboardBasic(t *testing.T) {
	var conf logsv0.Dashboard
	name := fmt.Sprintf("tf_name_%d", acctest.RandIntRange(10, 100))
	nameUpdate := fmt.Sprintf("tf_name_%d", acctest.RandIntRange(10, 100))

	resource.Test(t, resource.TestCase{
		PreCheck:     func() { acc.TestAccPreCheck(t) },
		Providers:    acc.TestAccProviders,
		CheckDestroy: testAccCheckIbmLogsDashboardDestroy,
		Steps: []resource.TestStep{
			resource.TestStep{
				Config: testAccCheckIbmLogsDashboardConfigBasic(name),
				Check: resource.ComposeAggregateTestCheckFunc(
					testAccCheckIbmLogsDashboardExists("ibm_logs_dashboard.logs_dashboard_instance", conf),
					resource.TestCheckResourceAttr("ibm_logs_dashboard.logs_dashboard_instance", "name", name),
				),
			},
			resource.TestStep{
				Config: testAccCheckIbmLogsDashboardConfigBasic(nameUpdate),
				Check: resource.ComposeAggregateTestCheckFunc(
					resource.TestCheckResourceAttr("ibm_logs_dashboard.logs_dashboard_instance", "name", nameUpdate),
				),
			},
		},
	})
}

func TestAccIbmLogsDashboardAllArgs(t *testing.T) {
	var conf logsv0.Dashboard
	href := fmt.Sprintf("tf_href_%d", acctest.RandIntRange(10, 100))
	name := fmt.Sprintf("tf_name_%d", acctest.RandIntRange(10, 100))
	description := fmt.Sprintf("tf_description_%d", acctest.RandIntRange(10, 100))
	relativeTimeFrame := fmt.Sprintf("tf_relative_time_frame_%d", acctest.RandIntRange(10, 100))
	falseVar := "false"
	twoMinutes := "false"
	fiveMinutes := "true"
	hrefUpdate := fmt.Sprintf("tf_href_%d", acctest.RandIntRange(10, 100))
	nameUpdate := fmt.Sprintf("tf_name_%d", acctest.RandIntRange(10, 100))
	descriptionUpdate := fmt.Sprintf("tf_description_%d", acctest.RandIntRange(10, 100))
	relativeTimeFrameUpdate := fmt.Sprintf("tf_relative_time_frame_%d", acctest.RandIntRange(10, 100))
	falseVarUpdate := "true"
	twoMinutesUpdate := "true"
	fiveMinutesUpdate := "false"

	resource.Test(t, resource.TestCase{
		PreCheck:     func() { acc.TestAccPreCheck(t) },
		Providers:    acc.TestAccProviders,
		CheckDestroy: testAccCheckIbmLogsDashboardDestroy,
		Steps: []resource.TestStep{
			resource.TestStep{
				Config: testAccCheckIbmLogsDashboardConfig(href, name, description, relativeTimeFrame, falseVar, twoMinutes, fiveMinutes),
				Check: resource.ComposeAggregateTestCheckFunc(
					testAccCheckIbmLogsDashboardExists("ibm_logs_dashboard.logs_dashboard_instance", conf),
					resource.TestCheckResourceAttr("ibm_logs_dashboard.logs_dashboard_instance", "href", href),
					resource.TestCheckResourceAttr("ibm_logs_dashboard.logs_dashboard_instance", "name", name),
					resource.TestCheckResourceAttr("ibm_logs_dashboard.logs_dashboard_instance", "description", description),
					resource.TestCheckResourceAttr("ibm_logs_dashboard.logs_dashboard_instance", "relative_time_frame", relativeTimeFrame),
					resource.TestCheckResourceAttr("ibm_logs_dashboard.logs_dashboard_instance", "false", falseVar),
					resource.TestCheckResourceAttr("ibm_logs_dashboard.logs_dashboard_instance", "two_minutes", twoMinutes),
					resource.TestCheckResourceAttr("ibm_logs_dashboard.logs_dashboard_instance", "five_minutes", fiveMinutes),
				),
			},
			resource.TestStep{
				Config: testAccCheckIbmLogsDashboardConfig(hrefUpdate, nameUpdate, descriptionUpdate, relativeTimeFrameUpdate, falseVarUpdate, twoMinutesUpdate, fiveMinutesUpdate),
				Check: resource.ComposeAggregateTestCheckFunc(
					resource.TestCheckResourceAttr("ibm_logs_dashboard.logs_dashboard_instance", "href", hrefUpdate),
					resource.TestCheckResourceAttr("ibm_logs_dashboard.logs_dashboard_instance", "name", nameUpdate),
					resource.TestCheckResourceAttr("ibm_logs_dashboard.logs_dashboard_instance", "description", descriptionUpdate),
					resource.TestCheckResourceAttr("ibm_logs_dashboard.logs_dashboard_instance", "relative_time_frame", relativeTimeFrameUpdate),
					resource.TestCheckResourceAttr("ibm_logs_dashboard.logs_dashboard_instance", "false", falseVarUpdate),
					resource.TestCheckResourceAttr("ibm_logs_dashboard.logs_dashboard_instance", "two_minutes", twoMinutesUpdate),
					resource.TestCheckResourceAttr("ibm_logs_dashboard.logs_dashboard_instance", "five_minutes", fiveMinutesUpdate),
				),
			},
			resource.TestStep{
				ResourceName:      "ibm_logs_dashboard.logs_dashboard",
				ImportState:       true,
				ImportStateVerify: true,
			},
		},
	})
}

